import React from 'react'
import axios from 'axios'
import { useEffect,useState } from 'react'

function App() {


  const [detail,setDetail]= useState("")
  useEffect(()=>{
    axios.get('https://alpha-vantage.p.rapidapi.com/query',{headers:{
      'X-RapidAPI-Key': '0f580a7692mshf1cde394489787ep110bedjsna00ae6955030',
      'X-RapidAPI-Host': 'alpha-vantage.p.rapidapi.com'
      }},{params}).then((res)=>{
      const details = res.data;
      setDetail(details)
    })

  },[])



  return (
    <div>
      <button>update count</button>
      {detail && detail.localeCompare(datax =>{
        const {id,data} = datax
        return(
          <div key={id}>
            <h5>{data}</h5>
          </div>
        )
      })}
    </div>
  )
}

export default App
